import React from 'react'

export function Dynamo (){
    return (<div>
        <h1>Dynamo Database</h1>
        <Get />
        <Put />
    </div>)
}

function Put(){
    return <form action="https://slbtptu9k6.execute-api.us-east-1.amazonaws.com/Prod/dynamodb" method="post">
        <input type="text" name="studentID" id="studentID"/>
        <input type="text" name="Fname" id="Fname"/>
        <input type="text" name="Lname" id="Lname"/>
        <button>Put</button>
        </form>
}

function getLucas(e){
    fetch('https://slbtptu9k6.execute-api.us-east-1.amazonaws.com/Prod/dynamodb')
  .then((response) => {
    return response.json();
  })
  .then((myJson) => {
    console.log(myJson.Item);
  });
}

function Get(){
    return (<button onClick={getLucas}>Get</button>)
}
